import React from 'react';
import Post from '../Components/Post'
import styled from 'styled-components'

const Feed = props => {

    const feed = props.data.map(post => 
        <Post 
            data={post} 
            mode={props.mode}
        />
    )

    return (
        <Container>
            {feed}
        </Container>
    );
}

const Container = styled.div`
    -moz-column-count: 4;
    -webkit-column-count: 4;
    column-count: 4;
    -moz-column-gap: 1em;
    -webkit-column-gap: 1em;
    column-gap: 1em;;
    max-width: 1280px;
`

export default Feed;
